  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;&lt;strong&gt;Overview&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;GMAT
  is a feature rich system containing high fidelity space system models, optimization
  and targeting,&lt;br /&gt;built in scripting and programming infrastructure, and
  customizable plots, reports and data&lt;br /&gt;products, to enable flexible analysis
  and solutions for custom and unique applications. GMAT can&lt;br /&gt;be driven
  from a fully featured, interactive GUI or from a custom script language. Here are
  some&lt;br /&gt;of GMAT&amp;rsquo;s key features broken down by feature group.&lt;/p&gt;&lt;p&gt;&lt;strong&gt;Dynamics
  and Environment Modelling&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;High fidelity
  dynamics models including harmonic gravity, drag, tides, and relativistic corrections&lt;/li&gt;&lt;li&gt;High
  fidelity spacecraft modeling&lt;/li&gt;&lt;li&gt;Formations and constellations&lt;/li&gt;&lt;li&gt;Impulsive
  and finite maneuver modeling and optimization&lt;/li&gt;&lt;li&gt;Propulsion system
  modeling including tanks and thrusters&lt;/li&gt;&lt;li&gt;Solar System modeling
  including high fidelity ephemerides, custom celestial bodies, libration points,
  and barycenters&lt;/li&gt;&lt;li&gt;Rich set of coordinate system including J2000,
  ICRF, fixed, rotating, topocentric, and many others&lt;/li&gt;&lt;li&gt;SPICE kernel
  propagation&lt;/li&gt;&lt;li&gt;Propagators that naturally synchronize epochs of
  multiple vehicles and avoid fixed step integration&lt;/li&gt;&lt;li&gt;and interpolation&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;Plotting,
  Reporting and Product Generation&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Interactive
  3-D graphics&lt;/li&gt;&lt;li&gt;Customizable data plots and reports&lt;/li&gt;&lt;li&gt;Post
  computation animation&lt;/li&gt;&lt;li&gt;CCSDS, SPK, and Code-500 ephemeris generation&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;Optimization
  and Targeting&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Boundary value targeters&lt;/li&gt;&lt;li&gt;Nonlinear,
  constrained optimization&lt;/li&gt;&lt;li&gt;Custom, scriptable cost functions&lt;/li&gt;&lt;li&gt;Custom,
  scriptable nonlinear equality and inequality constraint functions&lt;/li&gt;&lt;li&gt;Custom
  targeter controls and constraints&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;Programming
  Infrastructure&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;User defined variables,
  arrays, and strings&lt;/li&gt;&lt;li&gt;User defined equations using MATLAB syntax.
  (i.e. overloaded array operation)&lt;/li&gt;&lt;li&gt;Control flow such as If, For,
  and While loops for custom applications&lt;/li&gt;&lt;li&gt;Matlab interface&lt;/li&gt;&lt;li&gt;Built
  in parameters and calculations in multiple coordinate systems&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;strong&gt;Interfaces&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Fully
  featured, interactive GUI that makes simple analysis quick and easy&lt;/li&gt;&lt;li&gt;Custom
  scripting language that makes complex, custom analysis possible&lt;/li&gt;&lt;li&gt;Matlab
  interface for custom external simulations and calculations&lt;/li&gt;&lt;li&gt;File
  interface for the TCOPS Vector Hold&lt;/li&gt;&lt;/ul&gt;\",\n\t\"license_title\":
